import React, { useState } from 'react';
import './Login.css';
import googleImage from './google-logo.png';
import facebookImage from './facebook-logo.png';
import user_icon from '../Assets/user.png';
import email_icon from '../Assets/email.png';
import password_icon from '../Assets/password.png';
import axios from 'axios'; // Import axios for API requests

const Login = () => {
    const [username, setUsername] = useState(''); // Store username
    const [password, setPassword] = useState(''); // Store password
    const [action, setAction] = useState('Login');
    const [error, setError] = useState(null); // To handle errors

    const handleLogin = async () => {
        try {
            const response = await axios.post('http://localhost:3000/login', {
                username,
                password,
            });
            // Save token to localStorage
            localStorage.setItem('token', response.data.token);
            // Optionally redirect the user or perform other actions
            alert('Login successful!');
        } catch (err) {
            setError(err.response?.data?.message || 'Login failed'); // Set error message
        }
    };

    return (
        <div className="main">
            <div className="company_name">
                <h1>KSE OFFICE SALE</h1>
                <div className="text_box">
                    <p className='text_login'>Big office, big company</p>
                </div>
            </div>          
            <div className ='container'>
                <div className ="header">
                    <div className="text">{action}</div>
                    <p className="headerText">Glad you're back!</p>
                    <div className="underline"></div>
                </div>
                <div className="inputs">
                    <div className="input">
                        <img src={user_icon} alt="" />
                        <input 
                            type="text" 
                            placeholder='Username' 
                            value={username} 
                            onChange={(e) => setUsername(e.target.value)} // Handle username input
                        />
                    </div>
                    <div className="input">
                        <img src={email_icon} alt="" />
                        <input 
                            type="email" 
                            placeholder='Email' 
                            value={email} 
                            onChange={(e) => setEmail(e.target.value)} // Optional: Handle email input
                        />
                    </div>
                    <div className="input">
                        <img src={password_icon} alt="" />
                        <input 
                            type="password" 
                            placeholder='Password' 
                            value={password} 
                            onChange={(e) => setPassword(e.target.value)} // Handle password input
                        />
                    </div>
                </div>
                {error && <p className="error">{error}</p>} {/* Display error message */}
                <div className="submit-container">
                    <div className="submit" onClick={handleLogin}>Login</div>
                </div> 
                <div className="forgot-password"><span>Forgot Password?</span></div>
                <div className="login-footer">
                    <div className="separator">
                        <hr />
                        <span>Or</span>
                        <hr />
                    </div>
                    <div className="social-login">
                        <button className="google_login">
                            <img alt="google_login" src={googleImage} className="login-media google" />
                        </button>
                        <button className="facebook_login">
                            <img alt="facebook_login" src={facebookImage} className="login-media facebook" />
                        </button>
                    </div>
                    <div className="footer-links">
                        <a href="#">Terms & Conditions</a>
                        <a href="#">Support</a>
                        <a href="#">Customer Care</a>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Login;
